import '../App.css';
import { Layout } from 'antd';
import { PageLayout } from './Layout';
const { Header, Footer, Sider, Content } = Layout;
import { Row, Col } from 'antd';

export const ProfileDetails = () => {
    return<PageLayout children={
    <Content>
        <Row>
            <Col span={24}>col</Col>
        </Row>
        <Row>
            <Col span={12}>col</Col>
            <Col span={12}>col</Col>
        </Row>
        <Row>
            <Col span={12}>col</Col>
            <Col span={12}>col</Col>
        </Row>
    </Content>
    
} />;
    
}
